import { Typography, Button, Grid } from "@material-ui/core";

const AssistanceType = ({ setStep, setFormData }) => {
  return (
    <Grid container>
      <Typography variant="h5">What do you seek?</Typography>
      <Button
        variant="contained"
        onClick={() => {
          setStep(1);
          setFormData("assistanceType", "counseling");
        }}
      >
        Counseling
      </Button>

      <Typography variant="body1">
        This impressive paella is a perfect party dish and a fun meal to cook
        together with your guests.
      </Typography>
      <br />

      <Button
        variant="contained"
        color="primary"
        onClick={() => {
          setStep(1);
          setFormData("assistanceType", "guidance");
        }}
      >
        Legal Guidance
      </Button>
      <br />

      <Button
        variant="contained"
        color="secondary"
        onClick={() => {
          setStep(1);
          setFormData("assistanceType", "action");
        }}
      >
        Legal Action
      </Button>
    </Grid>
  );
};

export default AssistanceType;
